import { Route, Switch } from 'react-router-dom';

// common
import Header from './components/common/Header';
import Footer from './components/common/Footer';
// main
import Content from './components/main/Content';
import Visual from './components/main/Visual';
// sub
import Department from './components/sub/Department';
import Youtube from './components/sub/Youtube';
import Gallery from './components/sub/Gallery';
import Community from './components/sub/Community';
import Location from './components/sub/Location';
import Members from './components/sub/Members';

import './scss/style.scss';

function App() {
	return (
		<>
			<Header />
			<Route exact path='/'>
				<Visual />
				{/* <Content /> */}
			</Route>

			<Route path='/Department' component={Department}></Route>
			<Route path='/department' component={Youtube}></Route>
			<Route path='/department' component={Gallery}></Route>
			<Route path='/department' component={Community}></Route>
			<Route path='/department' component={Location}></Route>
			<Route path='/department' component={Members}></Route>

			<Footer />
		</>
	);
}

export default App;
